import React from "react";

import { Link } from "react-router-dom";
function CategoryCard({ category }) {
  return (
    <div class="row">
      <div
        class="col-2"
        style={{ width: "180px", padding: "10px", margin: "10px" }}
      >
        <div class="card">
          <img src={category.imageUrl} />
          <div class="card-body">
            <h5 class="card-title">{category.name}</h5>
            <Link to={"/menu/" + category.id} class="btn btn-primary">
              View more
            </Link>
          </div>
        </div>
      </div>
    </div>
  );
}

export default CategoryCard;
